import { UilEstate, UilClipboardAlt } from "@iconscout/react-unicons";

export const SidebarData = [
  {
    icon: UilEstate,
    heading: "Account View",
    path: "/",
  },
  {
    icon: UilClipboardAlt,
    heading: "Transaction Log",
    path: "/transactions",
  },
];
